// src/index.js (or your main entry file)
import React from 'react';
import ReactDOM from 'react-dom/client';
import App from './App';
import UserProvider from './context/UserContext';// Adjust the path based on your project structure

const container = document.getElementById('root'); // Ensure you have a root element in your HTML
const root = ReactDOM.createRoot(container); // Create a root

root.render(
    <UserProvider>
        <App />
    </UserProvider>,
);
